import { useSelector } from "react-redux";

const ProductDetailPage = () => {
  const product = useSelector((state) => state.products.product);
  
  return (
    <>
      <h1>Product Detail Page</h1>
      {product.title}
    </>
  );
};

export default ProductDetailPage;
